import React, { useEffect, useState } from "react";
import { Switch, Route, Redirect } from "react-router-dom";
import routes from "routes/routes.js";
// components

import AdminNavbar from "components/Navbars/AdminNavbar.js";
import Sidebar from "components/Sidebar/Sidebar.js";
import ENUMS from "constants/appEnums";
import APP_CONSTANTS from "constants/appConstants";
import { Layout, Menu, Breadcrumb } from 'antd';
import { UserOutlined, LaptopOutlined, NotificationOutlined } from '@ant-design/icons';


export default function Admin(props) {
    const { Header, Content, Sider } = Layout;
    const { SubMenu } = Menu;

    const [noSidebarLayout, setNoSidebarLayout] = useState(false);

    const getRoutes = (routes) => {
        // if (!props.isAuthenticated) {
        //   return <Redirect to={{
        //       pathname: '/auth/login',
        //       state: { from: props.location }
        //     }}
        //   />
        // }
        console.log("asd")
        return routes.map((prop, key) => {
        if (prop.layout === ENUMS.ROUTES.ADMIN) {
            return (
            <Route
                path={prop.layout + prop.path}
                component={prop.component}
                key={key}
            />
            );
        } else {
            return null;
        }
        });
    };

    const getBrandText = (path) => {
        for (let i = 0; i < routes.length; i++) {
        if (
            path.indexOf(
            routes[i].layout + routes[i].path
            ) !== -1
        ) {
            return routes[i].name;
        }
        }
        return "Brand";
    };

    useEffect(() => {
        if (APP_CONSTANTS.ROUTES_WITHOUT_SIDEBAR.indexOf(props.location.pathname) > -1) {
        setNoSidebarLayout(true);
        }
    }, [props])
    return (
        <Layout>
            {/* <Header className="header">
                <div className="logo" />
                <Menu theme="dark" mode="horizontal" defaultSelectedKeys={['2']}>
                <Menu.Item key="1">nav 1</Menu.Item>
                <Menu.Item key="2">nav 2</Menu.Item>
                <Menu.Item key="3">nav 3</Menu.Item>
                </Menu>
            </Header> */}
            <Layout>
                <Sider width={200} className="site-layout-background"
                style={{
                    overflow: 'auto',
                    height: '100vh',
                    position: 'fixed',
                    left: 0,
                  }}
                >
                <Menu
                    mode="inline"
                    defaultSelectedKeys={['1']}
                    defaultOpenKeys={['sub1']}
                    style={{ height: '100%', borderRight: 0 }}
                >
                    <SubMenu key="sub1" icon={<UserOutlined />} title="subnav 1">
                    <Menu.Item key="1">option1</Menu.Item>
                    <Menu.Item key="2">option2</Menu.Item>
                    <Menu.Item key="3">option3</Menu.Item>
                    <Menu.Item key="4">option4</Menu.Item>
                    </SubMenu>
                    <SubMenu key="sub2" icon={<LaptopOutlined />} title="subnav 2">
                    <Menu.Item key="5">option5</Menu.Item>
                    <Menu.Item key="6">option6</Menu.Item>
                    <Menu.Item key="7">option7</Menu.Item>
                    <Menu.Item key="8">option8</Menu.Item>
                    </SubMenu>
                    <SubMenu key="sub3" icon={<NotificationOutlined />} title="subnav 3">
                    <Menu.Item key="9">option9</Menu.Item>
                    <Menu.Item key="10">option10</Menu.Item>
                    <Menu.Item key="11">option11</Menu.Item>
                    <Menu.Item key="12">option12</Menu.Item>
                    </SubMenu>
                </Menu>
                </Sider>
                <Layout style={{ padding: '0 24px 24px' }}>
                <Breadcrumb style={{ margin: '16px 0' }}>
                    <Breadcrumb.Item>Home</Breadcrumb.Item>
                    <Breadcrumb.Item>List</Breadcrumb.Item>
                    <Breadcrumb.Item>App</Breadcrumb.Item>
                </Breadcrumb>
                <Content
                    className="site-layout-background"
                    style={{
                    padding: 24,
                    margin: 0,
                    minHeight: 280,
                    }}
                >
                    Content
                </Content>
                </Layout>
            </Layout>
        </Layout>
        // <>
        // {
        //     !noSidebarLayout
        //     && <Sidebar />
        // }
        // <div className={"relative " + (!noSidebarLayout ? "bg-blueGray-100  md:ml-64" : "")}>
        //     <AdminNavbar 
        //     {...props}
        //     brandText={getBrandText(props.location.pathname)}
        //     />
        //     {/* Header */}
        //     <Switch>
        //     {getRoutes(routes)}
        //     <Redirect from="*" to="/admin/dashboard" />
        //     </Switch>
        // </div>
        // </>
    );
}
